    key: "attachEventsToBoardManual",
    value: function attachEventsToBoardManual() {
      var solitrio_self = this;
      var selected = ''; // prev selected

      $('.slot').off();
      $('.slot').on('click', function () {
        var card = $(this).attr('id');
        if (selected === card) {
          //Selecting same card again
          solitrio_self.untoggleCard(card);
          selected = '';
          $('#rowbox').removeClass('selected');
          return;
        } else {
          if (!selected) {
            //New Card
            if (solitrio_self.game.board[card][0] !== 'E') {
              selected = card;
              solitrio_self.toggleCard(card);
              $('#rowbox').addClass('selected');
              solitrio_self.dynamicColoring(selected);
              return;
            }
          } else {
            //Change selection
            if (solitrio_self.game.board[card][0] !== 'E') {
              solitrio_self.untoggleCard(selected);
              solitrio_self.toggleCard(card);
              selected = card;
              solitrio_self.dynamicColoring(selected);
              return;
            }

            // Move card to empty slot if it is legal
            // selected must work in this context
            if (solitrio_self.canCardPlaceInSlot(selected, card)) {
              solitrio_self.prependMove("move\t".concat(selected, "\t").concat(card));
              //solitrio_self.endTurn();

              var x = JSON.stringify(solitrio_self.game.board[selected]);
              var y = JSON.stringify(solitrio_self.game.board[card]);
              solitrio_self.game.board[selected] = JSON.parse(y);
              solitrio_self.game.board[card] = JSON.parse(x);
              solitrio_self.untoggleCard(card);
              solitrio_self.untoggleCard(selected);
              $('#' + selected).html(solitrio_self.returnCardImageHTML(solitrio_self.game.board[selected]));
              $('#' + card).html(solitrio_self.returnCardImageHTML(solitrio_self.game.board[card]));
              $('#' + selected).toggleClass('empty');
              $('#' + card).toggleClass('empty');
              $('#rowbox').removeClass('selected');
              selected = '';
              solitrio_self.checkBoardStatus();
              return;
            } else {
              //SmartTip, slightly redundant with internal logic of canCardPlaceInSlot
              var smartTip;
              var predecessor = solitrio_self.getPredecessor(card);
              if (predecessor) {
                var cardValue = parseInt(solitrio_self.returnCardNumber(predecessor)) + 1;
                if (cardValue < 11) smartTip = 'Hint: Try a ' + cardValue + ' of ' + solitrio_self.cardSuitHTML(solitrio_self.returnCardSuite(predecessor));else smartTip = 'Unfortunately, no card can go there';
              } else {
                smartTip = 'Hint: Try a 2 of any suit';
              }
              //Feedback
              $(this).toggleClass('misclick');
              solitrio_self.untoggleCard(selected);
              selected = '';
              $('#rowbox').removeClass('selected');
              return;
            }
          }
        }
      });
    }
